import React from 'react'
import {Link, RouteComponentProps} from 'react-router-dom'
import { useMeQuery, useLogoutMutation } from '../generated/graphql'
import { setAccessToken } from '../accessToken'
import {AppBar, Toolbar, IconButton, Grid, Button} from "@material-ui/core"

interface Props {

}

export const Header: React.FC<RouteComponentProps> = ({history}) => {
    const {data, loading} = useMeQuery({fetchPolicy: "network-only"})
    const [logout, {client}] = useLogoutMutation();

    console.log(data)

    let body: any = null;
    if(loading){
        body = null;
    } else if(data && data.me) {
      body = (<div>{data.me.email}
        <Button color="inherit" onClick={async () =>{
          await logout();
          setAccessToken("");
          await client!.resetStore();
          history.push("/")
        }}>logout</Button>
      </div>)
    } else {
        body = ( <div>
          <Button href="/login" color="inherit">Login</Button>
          <Button href="/register" color="inherit">Register</Button> 
        </div>);
    }
    return (

    <header> 
      <AppBar position="static">   
        <Toolbar>
            <Grid
              justify="space-between" // Add it here :)
              container
            >
            <Grid item>
              <IconButton href="/" edge="start" color="inherit" aria-label="menu">
              Club Gr√ºn
              </IconButton>
            </Grid>

            <Grid item>
                {body}
            </Grid>
        </Grid>
      </Toolbar>
      </AppBar> 
        <div>
          <Link to="/access">bye</Link>
        </div>
    </header>
        )
}
